        public static NPC Create_Binary(
            MutagenFrame frame,
            RecordTypeConverter recordTypeConverter,
            ErrorMaskBuilder errorMask)
        {
            return UtilityTranslation.MajorRecordParse<NPC>(
                record: new NPC(),
                frame: frame,
                errorMask: errorMask,
                recType: NPC_Registration.NPC__HEADER,
                recordTypeConverter: recordTypeConverter,
