        public NPC Copy(
            NPC_CopyMask copyMask = null,
            INPCGetter def = null)
        {
            return NPC.Copy(
                this,
                copyMask: copyMask,
                def: def);
        }

        public static NPC Copy(
            INPC item,
            NPC_CopyMask copyMask = null,
            INPCGetter def = null)
        {
            NPC ret;
            if (item.GetType().Equals(typeof(NPC)))
            {
                ret = new NPC();
            }
            else
            {
                ret = (NPC)System.Activator.CreateInstance(item.GetType());
            }
            ret.CopyFieldsFrom(
                item,
                copyMask: copyMask,
                def: def);
            return ret;
        }

        public static NPC Copy_ToLoqui(
            INPCGetter item,
            NPC_CopyMask copyMask = null,
            INPCGetter def = null)
        {
            NPC ret;
            if (item.GetType().Equals(typeof(NPC)))
            {
                ret = new NPC() as NPC;
            }
            else
            {
                ret = (NPC)System.Activator.CreateInstance(item.GetType());
            }
            ret.CopyFieldsFrom(
                item,
                copyMask: copyMask,
                def: def);
            return ret;
        }

        public void CopyFieldsFrom(
            INPCGetter rhs,
            NPC_CopyMask copyMask,
            INPCGetter def = null,
            NotifyingFireParameters cmds = null)
        {
            this.CopyFieldsFrom(
                rhs: rhs,
                def: def,
                doMasks: false,
                errorMask: out var errMask,
                copyMask: copyMask,
                cmds: cmds);
        }

        public void CopyFieldsFrom(
            INPCGetter rhs,
            out NPC_ErrorMask errorMask,
            NPC_CopyMask copyMask = null,
            INPCGetter def = null,
            NotifyingFireParameters cmds = null,
            bool doMasks = true)
        {
            var errorMaskBuilder = new ErrorMaskBuilder();
            NPCCommon.CopyFieldsFrom(
                item: this,
                rhs: rhs,
                def: def,
                errorMask: errorMaskBuilder,
                copyMask: copyMask,
                cmds: cmds);
            errorMask = NPC_ErrorMask.Factory(errorMaskBuilder);
        }

