            switch (enu)
            {
                case NPC_FieldIndex.Name:
                    this.SetName(
                        (String)obj,
                        cmds: cmds);
                    break;
                case NPC_FieldIndex.Model:
                    this.SetModel(
                        (Model)obj,
                        cmds: cmds);
                    break;
                case NPC_FieldIndex.NPCFlags:
                    this.SetNPCFlags(
                        (NPC.NPCFlag)obj,
