                        (UInt16)obj,
                        cmds: cmds);
                    break;
                case NPC_FieldIndex.Fatigue:
                    this.SetFatigue(
                        (UInt16)obj,
                        cmds: cmds);
                    break;
                case NPC_FieldIndex.BarterGold:
                    this.SetBarterGold(
                        (UInt16)obj,
                        cmds: cmds);
                    break;
                case NPC_FieldIndex.LevelOffset:
                    this.SetLevelOffset(
                        (Int16)obj,
                        cmds: cmds);
                    break;
                case NPC_FieldIndex.CalcMin:
                    this.SetCalcMin(
                        (UInt16)obj,
